import Image from '../src/mypicc.jpg'


export class App extends Component {
  render() {
    return (
      <main className="App">
        <div className='myPic'>
          <img src={Image} alt = 'Img' className='__myPic'/>
        </div>
        <div className='descri'>
          <h1 className='__descri'>
            Hi,<br/>I'm Ayman,<br/>Web Develober Based In Gremany.<br/><span className="front">Front Developer HTML/CSS/React.</span>
          </h1>
        </div>
      </main>
    )
  }
}

export default App
